import React from "react";
import './Sobre.css'

function Sobre(){
    return(
        <section className="sobre">
            <h1>Sobre</h1>
            <img src="/imagens/nene.jpeg" id="foto"/>
            <h3> <p id="nene">Duck Mendes</p>
                <br/>
            Esse sou eu !! <br/>

            Meu nome é Duck e eu sou um hamster anão russo de 1 ano e 5 meses.
            Adoro girar na minha ródinha e amo sementes de girassol </h3>
        </section>
        )
}

export default Sobre
